import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import App from './App';
import FontStyles from './theme/FontStyle';

ReactDOM.render(
  <Router>
    <React.StrictMode>
      <FontStyles />
      <App />
    </React.StrictMode>
  </Router>,
  document.getElementById('root')
);
Modal.setAppElement('#root');

